import { DASHBOARD_GET_DATA } from '../actions/types'

const DEFAULT_STATE = {
    secret: ''
}

export default (state = DEFAULT_STATE, action) => {
    switch(action.type){
        case DASHBOAR_GET_DATA:
            console.log('authReducer got an AUTH_SIGN_UP action ')
            return { ...state, secret: action.payload}
        default:
        return state
    }
}
